import React from 'react';
import Logo from '../img/logo.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';

const element = <FontAwesomeIcon icon={faEnvelope} />;

const Header = () => {
  return (
    <nav>
      <div class="itemNav">
        <div class="itemLogo">
          <img class="logo-img" src={Logo} id="home" alt="logo" />
        </div>
        <div class="itemSearch">
          <input id="buscar" type="text" placeholder="Escriba aquÃ­..." />
          <div id="starSearch" class="fa fa-search buttonSearch"></div>
        </div>
        <div class="contenedorBars">
          <FontAwesomeIcon icon={solid('user-secret')} />
          <FontAwesomeIcon icon="fa-solid fa-bars" />
          <FontAwesomeIcon icon={element} />
          {/* <div class="fa fa-bars bars"></div> */}
        </div>

        <ul class="menuSmall" id="nav"></ul>
      </div>
    </nav>
  );
};

export default Header;
